(2, 8, 12, 1.00, 'Perfect +++++++++ i love it really also i get to fast ticket answers... Thanks Lot BOTBLE Teams', 'published', '2023-05-02 21:10:11', '2023-05-02 21:10:11', '{\"0\":\"products\\/4.jpg\",\"2\":\"products\\/56.jpg\"}'),
(3, 2, 7, 5.00, 'This web app is really good in design, code quality & features. Besides, the customer support provided by the Botble team was really fast & helpful. You guys are awesome!', 'published', '2023-05-02 21:10:11', '2023-05-02 21:10:11', '[\"products\\/1.jpg\",\"products\\/40.jpg\"]'),
