(5, 8, 20, 4.00, 'Customer Support are grade (A*), however the code is a way too over engineered for it\'s purpose.', 'published', '2023-05-02 21:10:11', '2023-05-02 21:10:11', '[\"products\\/3.jpg\"]'),
(6, 1, 40, 3.00, 'The best ecommerce CMS! Excellent coding! best support service! Thank you so much..... I really like your hard work.', 'published', '2023-05-02 21:10:11', '2023-05-02 21:10:11', '{\"0\":\"products\\/23.jpg\",\"2\":\"products\\/55.jpg\"}'),
(7, 7, 13, 2.00, 'Great E-commerce system. And much more : Wonderful Customer Support.', 'published', '2023-05-02 21:10:11', '2023-05-02 21:10:11', '[\"products\\/11.jpg\",\"products\\/43.jpg\"]'),
(8, 5, 46, 5.00, 'Second or third time that I buy a Botble product, happy with the products and support. You guys do a good job :)', 'published', '2023-05-02 21:10:11', '2023-05-02 21:10:11', '[\"products\\/14.jpg\",\"products\\/49.jpg\",\"products\\/53.jpg\"]'),
(9, 5, 6, 5.00, 'This script is well coded and is super fast. The support is pretty quick. Very patient and helpful team. I strongly recommend it and they deserve more than 5 stars.', 'published', '2023-05-02 21:10:11', '2023-05-02 21:10:11', '[\"products\\/23.jpg\"]'),
